    [],nt"num_tags": 0,nt"name": "two-24-hour-studies-of-water-quality-in-the-ala-wai-canal-during-march-and-july-1994-for-the-maa6abe",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset focuses on studies of water
    quality in the Ala Wai Canal in order to determine its role of point and non point
    source disharge into Mamala Bay. The Pollutant Source Identification Project (MB-3)
    sought to provide a summary and analysis of pollutant loads to Mamala Bay from both
    point and nonpoint sources. One aspect of the study was the run-off into the ocean
    from the Ala Wai Canal. For better understanding the processes in the Ala Wai Canal,
    two 24-hour intensive sampling studies were performed. Measurements included temperature,
    salinity, water velocity, and various water quality parameters. The field work took
    place from 25-26 March and 6-7 July 1994.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
